// Filter applies the BacktestWhereInput filter on the BacktestQuery builder.
func (i *BacktestWhereInput) Filter(q *BacktestQuery) (*BacktestQuery, error) {
	if i == nil {
		return q, nil
	}
	p, err := i.P()
	if err != nil {
		if err == ErrEmptyBacktestWhereInput {
			return q, nil
		}
		return nil, err
	}
	return q.Where(p), nil
}

