// AddPredicates adds custom predicates to the where input to be used during the filtering phase.
func (i *TradeWhereInput) AddPredicates(predicates ...predicate.Trade) {
	i.Predicates = append(i.Predicates, predicates...)
}

// Filter applies the TradeWhereInput filter on the TradeQuery builder.
func (i *TradeWhereInput) Filter(q *TradeQuery) (*TradeQuery, error) {
	if i == nil {
		return q, nil
	}
	p, err := i.P()
	if err != nil {
		if err == ErrEmptyTradeWhereInput {
			return q, nil
		}
		return nil, err
	}
	return q.Where(p), nil
}

